import React, { useEffect, useState } from "react";
import cartService from "../services/cartService";
import productService from "../services/productService";
import { useNavigate } from "react-router-dom";
import "./Cart.css";

const Cart = ({ username }) => {
  const [cartItems, setCartItems] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [subtotal, setSubtotal] = useState(0);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchCart = async () => {
      try {
        const response = await cartService.getCart(username);
        if (response.length > 0 && response[0].cart.items) {
          setCartItems(response[0].cart.items);
          setSubtotal(response[0].subtotal);
        } else {
          setCartItems([]);
        }
      } catch (err) {
        console.error("Error fetching cart:", err);
        setCartItems([]);
      } finally {
        setLoading(false);
      }
    };

    fetchCart();
  }, [username]);

  const handleBuyNow = () => {
    navigate("/checkout", { state: { cartItems } });
  };

  if (loading) return <p>Loading cart...</p>;
  if (cartItems.length === 0) return <p>Your cart is empty.</p>;

  return (
    <div className="cart-page">
      <div className="cart-container">
        {/* Order Summary Section */}
        <div className="order-summary">
          <h2>Order Summary</h2>
          <div className="summary-details">
            <p>
              <span>Items: </span>
              <span>{cartItems.length}</span>
            </p>
            <p>
              <span>Subtotal:</span>
              <span>${subtotal.toFixed(2)}</span>
            </p>
            <p>
              <span>Shipping:</span>
              <span>Free</span>
            </p>
          </div>
          <button className="checkout-button" onClick={handleBuyNow}>
            Checkout
          </button>
          {error && <p className="error-message">{error}</p>}
        </div>

        {/* Dark-Themed Card Details Section */}
        <div className="cart-details">
          <h2>Card Details</h2>
          <form>
            <div className="form-group">
              <label>Select Card Type</label>
              <div className="card-types">
                <span>Visa</span>
                <span>MasterCard</span>
                <span>Verve</span>
              </div>
            </div>
            <div className="form-group">
              <label>Card Number</label>
              <input type="text" placeholder="Enter your card number" />
            </div>
            <div className="form-group">
              <label>Expiry Date</label>
              <input type="text" placeholder="MM / YY" />
            </div>
            <div className="form-group">
              <label>CVV</label>
              <input type="text" placeholder="Enter CVV" />
            </div>
            <button className="checkout-button" onClick={handleBuyNow}>
              Checkout
            </button>
          </form>
        </div>
      </div>
    </div>
  );
};

export default Cart;
